import React, { useState, useEffect } from "react";
import Circle from "./Circle";

function List() {
  const [user, setUser] = useState([]);
  const [peopleInside, setPeopleInside] = useState([]);
  const [rfid, setRfid] = useState('')

  useEffect(() => {
    fetch("https://online.ntnu.no/api/v1/users/?rfid=0260434848")
      .then((res) => res.json())
      .then((res) => setUser(res.results[0]));
  }, []);

  function isAlreadyInside(rfid){
    if (peopleInside.includes(rfid)) {
        peopleInside.filter(rfid)
    }
    if (!peopleInside.includes(rfid)){
        peopleInside.push(rfid)
    }
  }
  console.log(user);
  return <Circle props={user} />;
}

export default List;
